      "job_apply_quality_score": 0.4005,
      "job_description": "Job Description\n\nTEAL is revolutionizing the hydronic industry by humanizing Hot Water, Chilled Water & Hydronic Heat. TEAL's innovation design - incorporating advanced AI technology and remote monitoring - far outperforms traditional central plants, resulting in a significantly reduced carbon footprint and the lowest total lifecycle cost. The future of central plants and your next opportunity are available today!\n\nPOSITION OVERVIEW:\n\nTeal is seeking a professional, skilled Python Software Developer for our Controls team. The successful candidate will work with the Teal software development team to develop and sustain technologies for HVAC commercial products. Teal operates an IOT network, which manages the operation and optimization of a distributed infrastructure system. Each node in the network uses a Teal control module to acquire data and transmit control logic to the underlying hardware.\n\nThe sites utilize common HVAC hardware including air handlers, fan coils, chillers, heat pumps, and boilers. The responsibilities of this position include the design, analysis, testing and documentation of software integrated into the control PCBs (embedded computer controllers). The control module designs use Wi-Fi, ethernet, modbus, and / or bacnet for communication. The Software Developer will work with the onshore and offshore team in managing ECC upgrades and new functionality from prototype through to production.\n\nKEY RESPONSIBILITIES:\n• Work with development team in designing programs (methods/functions) in Python\n• Demo, Test and qualify existing and new functionality\n• Identify opportunities within the existing and future firmware for continuous improvement\n• Use communication protocols to send and receive data from various devices\n• Contribute to the Agile framework, used to manage projects from concept to release\n• Document activities (requirements, code, schematics, layouts, etc.)\n• Participate on cross functional teams to launch products, resolve issues, and support product improvements\n• Work with Data Science on managing data from IOT network through data factory to analytics\n• Drive continuous improvement projects related to product design and quality QUALIFICATIONS &\n\nSKILLS:\n• Bachelor's degree in Electrical Engineering or Computer Science\n• 5+ years experience with in software development, preferably related to controls or similar\n• Knowledge of python, HTML, Javascript and Linux like environments\n• Knowledge of .net and visual studio (preferred but not required)\n• Knowledge of databases such as sqlite, mssql, mongodb\n• Knowledge of consuming and calling REST APIs\n• Experience with ADC/DAC controls\n• Effective communication skills - both oral and written COMPENSATION &\n\nBENEFITS:\n• PTO Allotment of 120 hours / 3 weeks after 90 days of employment\n• Competitive Compensation\n• Holistic Health Coverage (medical, dental, vision, life insurance, disability), including 24/7 medical concierge services\n• 401k Plan with a generous employer match\n• 10 Paid Holidays and Birthdays off\n• Cell Phone Allowance\n• Memberships to professional organizations are paid for by the Company\n• Casual Dress Code * $500 cash for first time home buyers!\n• Team building - Have fun with the team at sporting events, lunches, and other group festivities\n• Excellent growth and advancement opportunities. TEAL is an Equal Opportunity Employer. TEAL requires pre-employment background checks and drug screening. Company Description TEAL offers a centralized system that leverages cloud-based computing for 24/7/365 remote monitoring. Discover your managed mechanical systems as-a-service delivering uninterrupted chilled water, domestic hot water, and hydronic heat for residential and commercial developments of any size, nationwide.\n\nCompany Description\n\nTEAL offers a centralized system that leverages cloud-based computing for 24/7/365 remote monitoring. Discover your managed mechanical systems as-a-service delivering uninterrupted chilled water, domestic hot water, and hydronic heat for residential and commercial developments of any size, nationwide.",
