      "job_apply_is_direct": false,
      "job_apply_quality_score": 0.3939,
      "job_description": "Position: Senior Engineer / Python Developer with Django\n• * Description*\n• Mutual Mobile is a world-leading agency in mobile and emerging technology innovation, and we are looking for an accomplished and capable Python engineer to join our team! We have built our success through timely bets on emerging technology and rapid execution of targeted marketing campaigns and skills development. This approach has resulted in a list of premier clients that come to us to build innovative experiences using emerging technology (Nike, Google, GM, Nestle, Under Armour).\n\nWeve seen this happen with iOS, Android, Wearables, and IoT. We continue to evolve - its in our DNA - we stay at the forefront of innovation. Now, in 2020, we stand at the foot of a massive transition in emerging technology with the growth of Virtual Reality, Augmented Reality, Voice, Bots, and more. We are ready to embrace these changes and to help our clients make the most of the opportunities they bring.\n\nAt Mutual Mobile, Engineers are highly-capable, experienced producers of high-quality, extensible code. They know the ins-and-outs of their field, apply that knowledge to solve the most challenging problems, and pass along that knowledge to the next generation through mentorship.\n• Improve the structure, quality, and extensibility of codebases\n• Implement tools and best practices\n• Create reusable libraries and frameworks\n• Act as subject matter expert and contribute to the server center of excellence\n• Accurately estimate the level of effort.\n• Discover and evaluate new tools and technology partner\n• * Requirements*\n• ** We expect Engineers to:*\n• * Be highly-capable experts in at least one technology.\n• Build breadth across multiple tech stacks\n• Write high-quality, extensible, testable code.\n• Participate in planning activities and provide accurate story estimates\n• Conduct code reviews and act as a role model on the team\n• Proactively breakdown work, identify risks, and explore solutions.\n• * Engineers have experience:*\n• * Building backend in Python\n• Strong knowledge of the Django and Flask Framework\n• Knowledge of Postgre\n\nSQL and MongoDB\n• Experience in Redis or Memcached\n• Designing APIs consumed by mobile or web applications\n• Employing strong TDD and performance optimization strategies\n• Architecting and deploying applications for AWS\n• Provisioning Dev Ops tooling and continuous integration\n• Building high-performance, scalable cloud applications\n• Shipping fault-tolerant, highly-available systems in production\n• Good knowledge of authentication, authorization, and security technologies.\n• * Preferred experience includes:*\n• * Building server applications using several different open-source stacks\n• Using BaaS providers like Firebase or Heroku\n• Familiarity with modern front-end development such as React or Angular\n• Using containerisation systems like Docker or Kubernetes\n• Integrating third-party systems: CRM, CMS, shopping carts, and payments\n• Broad architectural knowledge and experience: serverless, microservices, traditional server-based (monolithic) services\n• System monitoring and security design and implementation\n• * Benefits*\n• We make great products. We craft beautiful mobile interfaces and solve complex software challenges. Clients such as HEB, Google, , Citi, Nike, and Under Armour come to us for our deep experience in mobile and emerging technology from establishing a mobile strategy that provides impactful business value to building those solutions from the ground up. We bring together the brightest minds in interactive & visual design, engineering, and business management to deliver solutions that matter.\n\nYoull love working here because this isnt a company of silos. Team members are empowered and encouraged to pursue cool ideas, think for themselves, and make mistakes. If your passion extends beyond the role, well invite your views and assistance with improving our culture, systems, and processes. We know youre smart and that you love learning new technologies--so youll be able to work on a variety of projects with many different types of people.",
