      "job_title": "Remote Computer Vision Engineer - Python, C++, Production",
      "job_apply_link": "https://www.linkedin.com/jobs/view/remote-computer-vision-engineer-python-c%2B%2B-production-at-cybercoders-3599721154",
      "job_apply_is_direct": false,
      "job_apply_quality_score": 0.5577,
      "job_description": "Job Title: REMOTE Computer Vision Engineer\n\nLocation: REMOTE - Anywhere in the US\n\nSalary: $160,000 - $200,000 Annual Base Salary, Unlimited PTO, 100% paid benefits for employee/80% paid for spouse and family\n\nRequirements: Python, C++, Production Experience\n\nWe are an AI-driven tech company designed to ease analytics and data tracking for fans, coaches, players, analysts, and well... everyone! No more need to hand-counting stats such as passes, sprints, etc. the computers will do it! Our platform is utilized by every team in the NBA, MLS, and Premier League. Easy to understand and fully customized pre and post-game reports are sent out after each game, bringing critical metrics right to your fingertips! We've won multiple awards including NBA Innovation Aware and Best in Tech at the 2019 Business Sports Awards! We use the latest and greatest tech and provide a collaborative remote environment!\n\nWe are currently looking for a Remote Computer Vision Engineer who is an expert with Python and C++ and has production experience. Our current CV Team consists of 12 engineers that live in different countries and a few in the US. This person will report to our Lead CV Engineer who is located in the US and mainly will work with the Lead.\n\nWhat You Will Be Doing\n• Reactor our tracking pipeline for more re-usability across projects\n• Develop and improve algorithms to satisfy current deliverables for NBA, EPL, MLS, and for smaller demos\n• Improve the speed on our NBA pipeline 1-second tracking\n• Broadcast camera calibration and tracking for our cutting edge augmented reality applications (RAE)\n\nWhat You Need for this Position\n• Python\n• C++\n• Production Experience\n• General CV skills (object detection, tracking, segmentation, 3D geometry, camera calibration)\n• Experience building large scale AI and distributed systems (Cloud computing)\n• Degree in Computer Software/Engineering\n• Experience with pose estimation (Plus)\n• Experience with action recognition (plus)\n\nWhat's In It for You\n• $160,000 - $200,000 Annual Base Salary\n• 100% Remote Work\n• Unlimited PTO\n• 401K up to 4% of gross earnings per pay period (dollar for dollar match)\n• 100% company-paid medical, dental, and vision for employees and 80% for spouses/families!\n• $3500 per year for further education and development such as getting a certification\n\nSo, if you are a Remote Computer Vision Engineer with experience, please apply today!\n\nColorado employees will receive paid sick leave. For additional information about available benefits, please contact Wendy Warner\n\nEmail Your Resume In Word To\n\nLooking forward to receiving your resume through our website and going over the position with you. Clicking apply is the best way to apply, but you may also:\n\nNitu.Gulati-Pauly@cybercoders.com\n• Please do NOT change the email subject line in any way. You must keep the JobID: linkedin : WW2-1681673L597 -- in the email subject line for your application to be considered.***\n\nNitu Gulati-Pauly - VP of Recruiting - CyberCoders\n\nApplicants must be authorized to work in the U.S.\n\nCyberCoders, Inc is proud to be an Equal Opportunity Employer\n\nAll qualified applicants will receive consideration for employment without regard to race, color, religion, sex, national origin, disability, protected veteran status, or any other characteristic protected by law.\n\nYour Right to Work – In compliance with federal law, all persons hired will be required to verify identity and eligibility to work in the United States and to complete the required employment eligibility verification document form upon hire.\n\nCyberCoders will consider for Employment in the City of Los Angeles qualified Applicants with Criminal Histories in a manner consistent with the requirements of the Los Angeles Fair Chance Initiative for Hiring (Ban the Box) Ordinance.",
