      "job_description": "Improving healthcare through innovative technology is at the core of Intelerad's work. Our scalable medical imaging platform connects clinicians to a powerful imaging ecosystem that is fast, smart, and tapped into the data they need, no matter their location. We're focused on delivering a best-in-class medical image management solution that improves provider efficiency, decreases the cost of healthcare, and improves the overall health of populations. Intelerad offers one of healthcare's most comprehensive imaging and analytics platforms. Headquartered in Raleigh, NC and Montreal, Intelerad has nearly 700 employees located in offices across six countries. The company empowers nearly 2,000 healthcare organizations around the world with the speed, scalability, and simplicity needed to increase business performance while, most importantly, improving patient outcomes. Intelerad's modern enterprise solutions have been acknowledged by a Best in KLAS recognition, ranking #1 for PACS Asia/Oceania in the 2021 Best in KLAS:\nGlobal Software (Non-US) report. To learn more, visit and follow Intelerad on LinkedIn and Twitter. Job Description The Site Reliability Engineering department is responsible for keeping all production systems running smoothly. As a Python Software Developer of the SRE Release Engineering team, you will be responsible for developing automation platforms and tools to support the delivery of Intelerad products. You are a solid Software Python Developer with experience in DevOps environments. You will be focused on Continuous Deployment tasks, bridging the gaps between development and operation activities by enforcing automation in deployment of applications. Software Development:\nContribute to the design, development, and maintenance of major features of Intelerad's products Apply professional design and development best-practices Balance deadlines, functionality, and quality Contribute to the improvement of and adherence to Intelerad's policies, procedures, and practices Proficiency in product knowledge and business space Understand the constraints of operating in a regulated development environment Maintain and improve the product's devops pipeline Document your work appropriately (requirements, designs, code, training information, etc.) Project Management:\nParticipate in project scoping, requirements gathering, and time estimation with minimal supervision. Strive to complete your deliverables according to requirements and within the time estimates. Balance maintenance responsibilities with project deliverables. Provide management with accurate and timely data regarding task progress. Teamwork:\nCollaborate with other team members to maximize the team's productivity and our product's quality. Stay current with developments in your discipline and share with the team your knowledge and promote opportunities for growth and improvement. Endeavour to improve our procedures and practices. Provide training to new team members and the different support teams. Qualifications Required:\nBachelor's degree in computer science, engineering OR equivalent experience 3\nyears professional experience developing commercial software using:\nBest practice object-oriented design and implementation methodologies Java and/or C+\nand/or python development or equivalent experience Complex, multi-threaded client/server architectures Database enabled applications Professional release management practices Linux / Unix environment Have prepared training material and given training to R&D staff. Approaches challenges as opportunities and sees every day as an opportunity to become a little bit better Excellent teamwork skills, and the ability to develop and maintain internal and external relationships Attention to detail and strong problem solving abilities Strong technical aptitude and an understanding of medical imaging Excellent verbal and written communication skills Preferred:\nFamiliarity with industry's standards (e.g., DICOM, HL-7, etc.) Experience with a broad range of Java technologies (e.g., JNI, JDBC, etc.) Perl and/or shell scripting PostgreSQL and/or Sybase ASE Network applications (client / server) Quality management systems (ISO 9001) Compression and encryption Familiarity with git and Jenkins. Knowledge of AWS services. Familiarity with Health care software\nSalary Range:\n$80K -- $100K\nMinimum Qualification\nSoftware DevelopmentEstimated Salary: $20 to $28 per hour based on qualifications.",
