      "job_apply_is_direct": true,
      "job_apply_quality_score": 0.5807,
      "job_description": "Our client is a rapidly growing Power & Gas commodity trading company, based out of Manhattan but with offices worldwide, including Houston is seeking a UI Front End Developer with heavy experience in utilizing DASH Python for their Houston office. If you have the talent and passion for building highly-interactive, innovative, and lightning-fast web UI, and interest in making a difference in the day to day lives of teams that are building blocks of the Trade Desk, through most expressive and data-rich interfaces in the world, then this is a great opportunity to bring your creativity, design, and engineering skills to bear to solve some of usability and interaction challenges anywhere.\n• You are a skilled front-end developer, with several years' experience in a modern, interactive client-side framework. (Dash Python)\n• You understand best practices on dynamic content creation and global deployments into AWS Cloud\n• You are passionate for building beautiful and seamless user interfaces. You know how to give users something that is more than just functional – you know how to delight them!\n• You work quickly and self-reliantly. We're not exactly a startup anymore, but we run our team like one – fast and lean – which means every engineer has a high degree of ownership and potential impact. Our engineers have the opportunity (and are expected) to exercise leadership and expertise in their daily work, having strongly held and defensible ideas, and advocating for what they believe is right. But they also need to be eager to hear differing opinions, adept at identifying and evaluating tradeoffs, willing to be proven wrong, and quick to walk through fire to help their fellow teammates.\n\nREQUIREMENTS:\n• You are a broadly skilled engineer with 5+ years experience, accustomed to developing Front End UI. You have experience building analytical web applications, working across a variety of technologies and service layers.\n• 5+ years of experience in Dash Python\n• Plotly Experienced Preferred\n• You understand engineering fundamentals and database technologies. This will be key to both designing world class solutions and also evaluating off the shelf systems in the market. You are able to work from first principles to evaluate solutions and adapt them to a unique environment..\n• You are a creative thinker, not bound by \"the way things have always been done\". What you know is less important than how well you learn and innovate. We don't need engineers who know all the answers; we need engineers who can invent the answers no one has thought of yet, to the questions yet to be asked.",
