      "job_apply_is_direct": false,
      "job_apply_quality_score": 0.4205,
      "job_description": "Share Only 2 Profiles With Govenment Client Experience.\n\nThe positions are hybrid ( local candidates only)\n\nPreferably Candidates With Texas State Governments Agencies Experience.\n\nShare the LinkedIn profile as well\n• Candidates local to Austin need apply**\n\nSummary\n\nImplement and develop websites, web applications and biomedical informatics tools to support clinical, medical education, health care, and health care research enterprise functionality. This person will collaborate closely with health care providers, web publishers, faculty, marketing/communications professionals, IT staff, and team members.\n\nThe ideal candidate is hands-on and highly capable of taking initiative for designing, prototyping, implementing, and providing long term support by effectively incorporating user and stakeholder input, and handling projects from database to application layer to effective UI\n\nResponsibilities\n• Create custom cloud-based web sites using content management systems (such as Craft) to support business needs.\n• Create custom applications with Python (or other languages) using cloud hosting.\n• Collaborate with different teams at our client's site to create secure, reliable, scalable web solutions using a lean and agile approach.\n• Work with other developers on the team for managing and monitoring servers and environments including account creation, server software, security, application deployment, and script creation.\n• Manage backups and restoration/rebuilding of deployed instances, with a strong emphasis on business continuity and disaster recovery.\n• Write custom code or scripts to automate infrastructure, monitoring services, and testing scenarios as needed.\n• Ensure DMS's internal web solutions adhere to industry-standard best practices and comply with all of UT's policies.\n• Other related duties assigned.\n\nRequired Qualifications\n• 5+ years experience in full stack software development\n• 5+ years w/ Python / Django experience\n• CICD Pipeline experience\n• AWS Cloud experience\n• Expertise with designing, developing, and deploying web applications using frameworks such as Django or Symfony.\n• Experience building API applications.\n• Comfort working with JavaScript, jQuery, and other JavaScript libraries.\n• Awareness of data formats such as JSON, HL7, or FHIR.\n• Expertise in responsive/mobile-first web design and strong UI/UX experience.\n• Demonstrable familiarity with security considerations of web applications.\n• Experience with content management systems such as Craft, Drupal, or WordPress. Knowledge of web accessibility standards.\n• Strong experience with current development standards and tools, including version control, automated testing, issue tracking, documentation, code reviews, continuous integration, continuous deployment, and containers.\n• Experience with QA testing procedures and developing test plans. Strong debugging skills. Experience with agile project management.\n• Awareness of how to properly handle sensitive data, such as Protected Health Information (PHI), and adhere to HIPAA, FERPA, Common Rule, and other regulations. Demonstrable flexible team experience.\n• Effective oral and written communication skills; strong ability to discuss technical issues with non-technical audiences.\n• Demonstrable ability to manage several projects concurrently. Equivalent combination of relevant education and experience may be substituted as appropriate.\n\nPreferred Qualifications\n• Experience with Terraform, CDK or other Infrastructure as Code (IAC) scripting languages.\n• Experience with databases such as MS SQL Server, MySQL, PostgreSQL, or NoSQL.\n• Experience with Kubernetes. Knowledge of AWS, GPC, and/or MS Azure management and deployment. Cloud certification (e.g., AWS Solutions Architect).\n• Experience with HIPAA and FERPA compliance.\n• Knowledge of managing web server software such as Apache or Nginx.\n• Experience with Java.\n• Familiarity with academic, biomedical, clinical, or health research.\n• Experience with dashboard-development applications such as Tableau and MS Power BI. Experience integrating applications with R or other statistical applications, including working with R-Shiny.",
