      "job_description": "Description\n\nThere’s never been a more exciting time to join United Airlines. We’re on a path towards becoming the best airline in the history of aviation. Our shared purpose – Connecting People, Uniting the World – is about more than getting people from one place to another. It also means that as a global company that operates in hundreds of locations around the world with millions of customers and tens of thousands of employees, we have a unique responsibility to uplift and provide opportunities in the places where we work, live and fly, and we can only do that with a truly diverse and inclusive workforce. And we’re growing – in the years ahead, we’ll hire tens of thousands of people across every area of the airline. Our careers include a competitive benefits package aimed at keeping you happy, healthy and well-traveled. From employee-run \"Business Resource Group\" communities to world-class benefits like parental leave, 401k and privileges like space available travel, United is truly a one-of-a-kind place to work. Are you ready to travel the world?\n\nWe believe that inclusion propels innovation and is the foundation of all that we do. United's Digital Technology team spans the globe and is made up of diverse individuals all working together with cutting-edge technology to build the best airline in the history of aviation. Our team designs, develops and maintains massively scaling technology solutions brought to life with innovative architectures, data analytics, and digital solutions.\n\nKey Responsibilities:\n\nThe Senior Developer plays a Critical role in creating and maintaining the strategic partnership between business needs and technology delivery. The Senior Developer's role is to lead the efforts to plan, design, develop and launch efficient systems and solutions in support of core organizational functions. This individual will apply proven communication, analytical and problem-solving skills to help identify, communicate and resolve issues, opportunities or problems in order to improve the benefit of IT and Business investments. The Senior Developer is highly experienced and has decision-making authority. The Senior Developer is self - sufficient, requires no direct supervision, and mentors/coaches others. The Principal Developer has extensive knowledge/experience across multiple technologies and business areas.\n• Leads the design, development, and planning for solutions and technology standards to solve complex business problems\n• Hands-on development, Support and solve software systems as required, optimizing performance, resolving problems and providing follow-up on all issues and solutions\n• Ensures that systems are properly integrated\n• Works with business, support, or development teams recommending system enhancements\n• Consults across multiple United Information Technology projects and technology areas to perform solving, problem management, root-cause analysis and solution implementation\n• Serves as a resource for technology/project development review and technical assessments\n• Ensures that the technical solutions meet the customers’ business goals\n• Provide consultation and technical leadership in project life cycle planning\n• Ensures consistency and coherence to the enterprise standards and guiding principles throughout the application lifecycle\n• Finds opportunities to leverage/influence the direction for existing infrastructure and application components\n• Stays ahead of industry trends through benchmarking, participation in professional associations etc. in order to advise others of strategic technology direction\n• Provides feedback to the enterprise technology owners and Architects regarding future solution needs\n• Understands and applies the enterprise vision and strategy to the project solution while balancing tactical needs to deliver\n• Partner with various business and IT collaborators in defining domain architecture strategy\n• Demonstrate exceptional knowledge of application architecture and architecture constructs as it connects to the enterprise architecture\n• Demonstrate mastery of the application of development domain areas and multiple technologies and tool set\n• Demonstrate mastery of software engineering\n\nUnited values diverse experiences, perspectives, and we encourage everyone who meets the minimum qualifications to apply. While having the “desired” qualifications make for a stronger candidate, we encourage applicants who may not feel they check ALL of those boxes! We are always looking for individuals who will bring something new to the table!\nQualifications\n\nWhat’s needed to succeed (Minimum Qualifications):\n• Bachelor’s in computer science/information technology or related field\n• 5+ years of experience in application design, development, installation and modification of software\n• 3+ years of experience as a Python developer\n• 2+ years of experience with Linux command line scripting (bash)\n• 3+ years of experience in design patterns and enterprise standards in application design\n• Experience with code management tools like Git, Github, Gitlab\n• Experience with the Eclipse development environment\n• Experience with relational database design and development\n• Eye For Business\n• Creativity & Innovation\n• Persuasion\n• \"Big Picture\" Problem solver\n• Strategic\n• Understands Technology systems & applications\n• Vendor Management\n• Exceptional at coding and on time delivery of quality components and or applications\n• Exceptional at component and unit testing of following standard practices and methodologies\n• Exceptional utilizing the technologies and domain knowledge with the delivery of developed components or integrated components\n• Exceptional at working problems of moderate scope where analysis of situations or data requires review of a variety of factors\n• Exceptional at triage or analysis of situations for production support\n• Excel with on time delivery with minimal supervision\n• Effective verbal and written communicator\n• Effective participant of requirements gathering, requirements analysis\n• Must be legally authorized to work in the United States for any employer without sponsorship\n• Successful completion of interview required to meet job qualification\n• Reliable, punctual attendance is an essential function of the position\n\nWhat will help you propel from the pack (Preferred Qualifications):\n• Java programming experience\n• VNC systems\n• Batch job management (e.g. Altair Grid Engine)\n• Jeppesen optimization tools (i.e. RAVE, Developers Workspace, Studio)\n• Constraint-based optimization (e.g. minizinc)\n• AWS\n\nUnited Airlines is an equal opportunity employer. United Airlines recruits, employs, trains, compensates and promotes regardless of race, religion, color, national origin, gender identity, sexual orientation, physical ability, age, veteran status and other protected status as required by applicable law. We will ensure that individuals with disabilities are provided reasonable accommodation to participate in the job application or interview process, to perform crucial job functions. Please contact JobAccommodations@united.com to request accommodation.\n\nEqual Opportunity Employer - Minorities/Women/Veterans/Disabled/LGBT",
