      "job_description": "Role: Python Developer\n\nLocation: Durham, NC/Westlake,TX/Smithfield, RI(Hybrid - 1 week per month)\n\nDuration: 12+ Months(Possible conversion)\n\nPay rate starts from: $60/hr on W2\n\nW2 Only Required Qualifications\n• Working knowledge of Unix OS /Shell scripting\n• Python is required and their frameworks or librarias.\n• Knowledge of Control-M/Automation tools.\n• Some experience in DevOps\n• Production Support will be required – one week every 3 months\n• Excellent interpersonal and communication skills\n• Excellent collaboration skills to work with multiple teams in the organization\nAdditional Experience\n• Learn New technologies and evaluate new products, participating in Proof of Concepts (POCs) is a plus\n• Vendor management is a plus\n• Some QA/Testing experience is a plus\n• Some Kubernetes / Docker experience is a plus\n• Strong communication and presentation skills\nBelow is the brief introduction of SPECTRAFORCE, the benefits we offer and the disclaimers:\n\nEstablished in 2004, SPECTRAFORCE is one of the largest and fastest-growing diversity-owned staffing firms in the US. The growth of our company is a direct result of our global client service delivery model that is powered by our state-of-the-art A.I. proprietary talent acquisition platform, robust ISO 9001:2015/ISO 27001 certified processes, and strong and passionate client engaged teams.\n\nWe have built our business by providing talent and project-based solutions, including Contingent, Permanent, and Statement of Work (SOW) services to over 130 clients in the US, Canada, Puerto Rico, Costa Rica, and India. Key industries that we service include Technology, Financial Services, Life Sciences, Healthcare, Telecom, Retail, Utilities and Transportation.\n\nSPECTRAFORCE is built on a concept of “human connection,” defined by our branding attitude of NEWJOBPHORIA®, which is the excitement of bringing joy and freedom to the work lifestyle so our people (and clients) can reach their highest potential. Our entire workflow and teams are trained to cultivate the joy of NEWJOBPHORIA® with candidates and employees throughout their engagement with SPECTRAFORCE. http://www.spectraforce.com\n\nBenefits: SPECTRAFORCE offers ACA compliant health benefits as well as dental, vision, accident, and hospital indemnity insurances. Additional benefits SPECTRAFORCE offers to the eligible employees include commuter benefits, 401K plan with matching and a referral bonus program. SPECTRAFORCEoffers unpaid leave as well as paid sick leave when required by law.\n\nEqual Opportunity Employer: SPECTRAFORCEis an equal opportunity employer and does not discriminate against any employee or applicant for employment because of race, religion, color, sex, national origin, age, sexual orientation, gender identity, genetic information, disability or veteran status, or any other category protected by applicable federal, state, or local laws. Please contact Human Resources at nahr@spectraforce.com if you require reasonable accommodation.",
