      "job_description": "About Us\n\nSynergistic IT is a full-service staffing and placement firm servicing client in America for the past 12+ years. We are dedicated towards fulfilling the IT needs of our clients. From staffing to full implementation of projects we provide the highest quality IT Services. We Intend to deliver exceptional student outcome. We don't just help you secure a tech job but build a solid career in technology.\n\nJob Description\n• Analyze and organize raw data\n• Build data systems and pipelines\n• Conduct complex data analysis and report on results\n• Prepare data for prescriptive and predictive modelling\n• Build algorithms and prototypes\n• Combine raw information from different sources\n• Explore ways to enhance data quality and reliability\n• Identify opportunities for data acquisition\n• Collaborate with data scientists and architects\n\nSkills Required-\n• Expertise In Core Python.\n• Good grasp of Web Frameworks.\n• Object Relational Mappers.\n• Road to Data Science.\n• Machine Learning and AI.\n• Deep Learning.\n• Understanding of Multi-Process Architecture.\n• Analytical skills\n\nEducation Requirement: -\n• Degree in Computer Science or equivalent, with strong fundamentals and problem-solving skills (such as data structures, computational algorithms, and operating systems).\n• 0-1+ years of Data engineering experience.\n\nBenefits\n• On Job Technical support\n• E- verified\n• Help to get H1B Employer.\n• Full time position\nCandidate who are missing the required skills, might be provided an option to enhance their skills, so that they can also apply for the role and can make a career in IT industry.\n\nplease also check the below links\n\nhttps://www.synergisticit.com/candidate-outcomes/\n\nhttps://www.synergisticit.com/java-track/\n\nhttps://www.synergisticit.com/data-science-track/\n\nIf you do respond via e-mail, please include a daytime phone number so that we can reach you. In considering candidates, time is of the essence, so please respond ASAP. Thank you",
